import React, { Component } from 'react';
import LylicBlock from './LylicBlock';

class ResultLylic extends Component {
  render() {
    const list = [];
    for (let i = 0; i < this.props.size; i++) {
      <LylicBlock key={i} />;
    }
    console.log(list);
    return <div>{list}</div>;
  }
}

export default ResultLylic;
